import React from 'react'
import '../../App.css'
import './Gallery.css';
import img1 from '../../images/gallery-1.jpeg'
import img2 from '../../images/gallery-2.jpeg'
import img3 from '../../images/gallery-3.jpeg'
import img4 from '../../images/gallery-4.jpeg'
import img5 from '../../images/gallery-5.jpeg'
import img6 from '../../images/gallery-6.jpeg'
import img7 from '../../images/gallery-7.jpeg'
import img8 from '../../images/gallery-8.jpeg'

function Gallery() {
  return (
    <div className='gallery'>
    <style>{'body { background-color: #070d2b; }'}</style>
      <ul className='Images'>
        <div className='gallery_line_1'>
          <img src={img1} height={350} width={400}/> {"   "}
          <img src={img2} height={350} width={400}/>
        </div>
        <div className='gallery_line-2'>
          <img src={img3} height={350} width={400}/> {" "}
          <img src={img4} height={350} width={400}/>
        </div>
        <div className='gallery_line-3'>
          <img src={img5} height={350} width={400}/> {" "}
          <img src={img6} height={350} width={400}/>
        </div>
        <div className='gallery_line-4'>
          <img src={img7} height={350} width={400}/> {" "}
          <img src={img8} height={350} width={400}/>
        </div>
      </ul>
    </div>
  )
}

export default Gallery
